import * as TW from "re-tailwind/src/TW.bs.js";
import * as React from "react";
import * as Caml_chrome_debugger from "bs-platform/lib/es6/caml_chrome_debugger.js";

function Header(Props) {
  return React.createElement("header", {
              className: TW.make(/* :: */Caml_chrome_debugger.simpleVariant("::", [
                      /* BackgroundColor */Caml_chrome_debugger.variant("BackgroundColor", 33, [/* BgIndigo700 */216]),
                      /* :: */Caml_chrome_debugger.simpleVariant("::", [
                          /* Display */Caml_chrome_debugger.variant("Display", 52, [/* Flex */3]),
                          /* :: */Caml_chrome_debugger.simpleVariant("::", [
                              /* JustifyContent */Caml_chrome_debugger.variant("JustifyContent", 17, [/* JustifyBetween */3]),
                              /* :: */Caml_chrome_debugger.simpleVariant("::", [
                                  /* Padding */Caml_chrome_debugger.variant("Padding", 8, [/* Py4 */23]),
                                  /* :: */Caml_chrome_debugger.simpleVariant("::", [
                                      /* Padding */Caml_chrome_debugger.variant("Padding", 8, [/* Px10 */46]),
                                      /* [] */0
                                    ])
                                ])
                            ])
                        ])
                    ]))
            }, React.createElement("nav", undefined, "Nav"));
}

var make = Header;

export {
  make ,

